import React from 'react';
import { Link } from 'react-router-dom';
import { Particles } from 'react-particles-js';

const Landing =() => {
    return (
        <div>
            <Particles
    params={{
	    "particles": {
	        "number": {
	            "value": 50
	        },
	        "size": {
	            "value": 3
	        }
	    },
	    "interactivity": {
	        "events": {
	            "onhover": {
	                "enable": true,
	                "mode": "repulse"
	            }
	        }
	    }
	}} />
        </div>
    );
}

export default Landing;
